import React from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note';


const App =()=>{

    const addNote= ()=>{
        alert('you clicked me')
    }
    return(
        <>
            <Header/>
             <CreateNote passnote={addNote}/>
             <Note/>
        </>
    )
}
export default App
